import React, { useState } from "react";
import { createRoot } from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import VideoSlider from "./VideoSlider.jsx";
// @ts-ignore
import './css/root.css';
import Footer from "./Footer.jsx";



function Root() {
    function assignVideoIds(videoLists) {
        let idCounter = 0;
        return videoLists.map((videos) => 
            videos.map((video) => ({ ...video, id: idCounter++ }))
        );
    }

    let travelVideos = [                   
        {videoUrl:"https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview", vertical: true, title: "Wisconsin", subtitle: "Summer '24"},
        {videoUrl:"https://drive.google.com/file/d/1X0-T5kGr11oA4hRPz-oF4ShhEqLNFahr/preview", vertical: true, title: "2024", subtitle: "Around the world"},
        {videoUrl:"https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview", vertical: true, title: "Wisconsin", subtitle: "Summer '24"},
        {videoUrl:"https://drive.google.com/file/d/1X0-T5kGr11oA4hRPz-oF4ShhEqLNFahr/preview", vertical: true, title: "2024", subtitle: "Around the world"},
        {videoUrl:"https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview", vertical: true, title: "Wisconsin", subtitle: "Summer '24"},
        {videoUrl:"https://drive.google.com/file/d/1X0-T5kGr11oA4hRPz-oF4ShhEqLNFahr/preview", vertical: true, title: "2024", subtitle: "Around the world"},
        {videoUrl:"https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview", vertical: true, title: "Wisconsin", subtitle: "Summer '24"},
        {videoUrl:"https://drive.google.com/file/d/1X0-T5kGr11oA4hRPz-oF4ShhEqLNFahr/preview", vertical: true, title: "2024", subtitle: "Around the world"},
        {videoUrl:"https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview", vertical: true, title: "Wisconsin", subtitle: "Summer '24"},
        {videoUrl:"https://drive.google.com/file/d/1X0-T5kGr11oA4hRPz-oF4ShhEqLNFahr/preview", vertical: true, title: "2024", subtitle: "Around the world"},
    ]

    
    travelVideos = assignVideoIds(travelVideos);

    return (
        <BrowserRouter>
            <div id="view">
                <h1>Video Gallery</h1>
                <h2>Travel</h2>
                <div>
                    <VideoSlider videoList={travelVideos}/>
                </div>

                <h2>Travel</h2>
                <div>
                    <VideoSlider videoList={travelVideos}/>
                </div>
            </div>

            <div id="footer">
                <Footer />
            </div>
        </BrowserRouter>
    );
}

const rootElement = document.getElementById("root");
if (rootElement) {
    createRoot(rootElement).render(<Root />);
}
